)
, tmpPartner_1 as (select trim (BranchName) as BranchName, trim (JuridicalId) :: Integer as JuridicalId_old, coalesce (ObjectLink.ChildObjectId, 0) as JuridicalId_curr, trim (PartnerId) :: Integer as PartnerId
                      , trim (JurName_old) as JurName_old, trim (PartnerName_old) as PartnerName_old, trim (OKPO_old) as OKPO_old
                      , trim (JurName) as JurName, trim (OKPO) as OKPO, trim (Code1C) as Code1C, trim (Name1C) as Name1C, trim (PaidKindName) as PaidKindName
                      , trim (Comment) as Comment
                      , trim (PostalCode) as PostalCode, trim (CityKindName) as CityKindName, trim (CityName) as CityName
                      , trim (RegionName) as RegionName, trim (ProvinceName) as ProvinceName, trim (StreetKindName) as StreetKindName, trim (StreetName) as StreetName
                      , trim (HouseNumber) as HouseNumber, trim (RoomNumber) as RoomNumber
                      , trim (PersonalName) as PersonalName, trim (PersonalTradeName)as PersonalTradeName
                      , trim (AreaName) as AreaName, trim (RetailName) as RetailName, trim (RetailKindName) as RetailKindName
                      , trim (a1) as a1, trim (a2) as a2, trim (a3) as a3, trim (b1) as b1, trim (b2) as b2, trim (b3) as b3, trim (c1) as c1, trim (c2) as c2, trim (c3) as c3
                      , trim (CityName) || trim (StreetName) || trim (HouseNumber) as Adr
                 from tmpPartner_all
                      left join ObjectLink on ObjectLink.ObjectId = trim (tmpPartner_all.PartnerId) :: Integer
                                          and ObjectLink.DescId = zc_ObjectLink_Partner_Juridical()
                 where trim (OKPO) <> '-'
                   and trim (OKPO) <> ''
                   and trim (JurName) <> ''
                )
, tmpPartner as (select *
                 from tmpPartner_1
                 where PartnerId not in (select PartnerId from (select PartnerId, Adr from tmpPartner_1 group by PartnerId, Adr) as a group by PartnerId having Count(*) > 1)
                )
